import React from "react";
import styles from "./HeaderInput.module.css";

const HeaderInput = (props) => {
  return (
    <div className={styles.container}>
      <div className={styles.col_1}>
        <input placeholder="       abc" className={styles.input1}></input>
      </div>
      <div className={styles.col_2}>
        <input placeholder="  123" className={styles.input2}></input>
      </div>
      <div className={styles.col_3}>
        <input placeholder="  123" className={styles.input3}></input>
      </div>
      <div className={styles.col_4}>
        <input className={styles.input4}></input>
      </div>
      <button className={styles.searchButton}>Search</button>
    </div>
  );
};

export default HeaderInput;
